-(void) hideNow
{
    self.hidden = YES;
}

-(void) setHidden:(BOOL)hidden
{
    [super setHidden:hidden];
}

- (NSDragOperation)draggingEntered:(id <NSDraggingInfo>)sender
{
    NSPasteboard *pb =[sender draggingPasteboard];
    NSArray *array=[pb types];
    if ([array containsObject:NSFilenamesPboardType]) {
        return NSDragOperationCopy;
    }
    return NSDragOperationNone;
}

-(void) uploadData:(NSData *)data extenstion:(NSString *)extenstion
{
    [DJProgressHUD showStatus:@"上传中..." FromView:self.superview];

    AFHTTPSessionManager * manager = [[AFHTTPSessionManager alloc] init];
    manager.responseSerializer = [AFJSONResponseSerializer serializer];
    
    NSMutableDictionary * dic = [NSMutableDictionary dictionary];
    
    dic[@"smfile"] = @"image";
    dic[@"ssl"] = @(NO);

    [manager POST:@"https://sm.ms/api/upload" parameters:dic constructingBodyWithBlock:^(id<AFMultipartFormData>  _Nonnull formData) {
        
        [formData appendPartWithFileData:data name:@"smfile" fileName:@"image" mimeType:extenstion];
        
        
    } success:^(NSURLSessionDataTask * _Nonnull task, id  _Nonnull responseObject) {
        
        NSString * url = responseObject[@"data"][@"url"];
        
        ImageSearchViewController * vc = [[ImageSearchViewController alloc] init];
        vc.imageURL = url;
        
        [self.parentViewController presentViewControllerAsModalWindow:vc];
        
        [DJProgressHUD dismiss];
        
    } failure:^(NSURLSessionDataTask * _Nonnull task, NSError * _Nonnull error) {
        
        [DJProgressHUD dismiss];

    }];
}

